          path="/vulnerabilities"
          element={
            <NewsList
              apiUrl="https://cybersecurity-news.p.rapidapi.com/vulnerabilities" // real endpoint here
              itemType="vulnerabilities"
            />
          }
        />
      </Routes>
    </Router>
  );
}
